    [],nt"revision_timestamp": "2015-12-20T18:44:33.668858",nt"name": "orthorectification-and-mosaicking-of-color-aerial-photography-for-the-main-eight-hawaiian-043040863",nt"isopen":
    false,nt"url": null,nt"notes": "Habitat maps of the main Hawaiian Islands
    were created by visual interpretation of aerial photos and hyperspectral imagery
    using the Habitat Digitizer extension. Aerial photographs are valuable tools for
    natural resource managers and researchers since they provide an excellent record
    of the location and extent of habitats. However, spatial distortions in aerial photographs
    due to such factors as camera angle, lens characteristics, and relief displacement
    must be accounted for during analysis to prevent incorrect measurements of area,
    distance, and other spatial parameters. These distortions of scale within an image
    can be removed through orthorectification. During orthorectification, digital scans
    of aerial photos are subjected to algorithms that eliminate each source of spatial
    distortion. The result is a georeferenced digital mosaic of several photographs
    with uniform scale throughout the mosaic. Features near land are generally georeferenced
    with greater accuracy while the accuracy of features away from land is generally
    not as good. Where no land is in the original photographic frame only kinematic
    GPS locations and image tie points were used to georeference the images. After an
    orthorectified mosaic is created, photointerpreters can accurately and reliably
    delineate boundaries of features in the imagery as they appear on the computer monitor
    using a software interface such as the Habitat Digitizer.",nt"license_title":
